// src/components/TutoringHistory.js
import React from 'react';

const TutoringHistory = () => {
  return (
    <div>
      <h2>Tutoring History</h2>
      <p>Here is where you can see your past tutoring sessions.</p>
    </div>
  );
};

export default TutoringHistory;
